import React, { useState } from 'react';
import './App.css';

function App() {
  const [carMake, setCarMake] = useState('');
  const [carModel, setCarModel] = useState('');
  const [year, setYear] = useState('');
  const [mileage, setMileage] = useState('');
  const [condition, setCondition] = useState('');
  const [features, setFeatures] = useState([]);
  const [transmission, setTransmission] = useState('');
  const [priceRange, setPriceRange] = useState([0, 100000]);
  const [contactNumber, setContactNumber] = useState('');

  const handleCarMakeChange = (event) => {
    setCarMake(event.target.value);
  };

  const handleCarModelChange = (event) => {
    setCarModel(event.target.value);
  };

  const handleYearChange = (event) => {
    setYear(event.target.value);
  };

  const handleMileageChange = (event) => {
    setMileage(event.target.value);
  };

  const handleConditionChange = (event) => {
    setCondition(event.target.value);
  };

  const handleFeaturesChange = (event) => {
    const feature = event.target.value;
    const isChecked = event.target.checked;
    if (isChecked) {
      setFeatures([...features, feature]);
    } else {
      setFeatures(features.filter((f) => f !== feature));
    }
  };

  const handleTransmissionChange = (event) => {
    setTransmission(event.target.value);
  };

  const handlePriceRangeChange = (values) => {
    setPriceRange(values);
  };

  const handleContactNumberChange = (event) => {
    setContactNumber(event.target.value);
  };

  const handleSubmit = (event) => {
    event.preventDefault();
    console.log({
      carMake,
      carModel,
      year,
      mileage,
      condition,
      features,
      transmission,
      priceRange,
      contactNumber,
    });
  };

  return (
    <div className="App">
      <h1>Car Sell App Form</h1>
      <form onSubmit={handleSubmit}>
        <label htmlFor="carMake">Car Make:</label>
        <input
          type="text"
          id="carMake"
          name="carMake"
          value={carMake}
          onChange={handleCarMakeChange}
          required
        />

        <label htmlFor="carModel">Car Model:</label>
        <input
          type="text"
          id="carModel"
          name="carModel"
          value={carModel}
          onChange={handleCarModelChange}
          required
        />

        <label htmlFor="year">Year:</label>
        <input
          type="date"
          id="year"
          name="year"
          value={year}
          onChange={handleYearChange}
          required
        />

        <label htmlFor="mileage">Mileage:</label>
        <input
          type="number"
          id="mileage"
          name="mileage"
          value={mileage}
          onChange={handleMileageChange}
          required
        />

        <label>Condition:</label>
        <div>
          <label htmlFor="excellent">
            <input
              type="radio"
              id="excellent"
              name="condition"
              value="Excellent"
              checked={condition === 'Excellent'}
              onChange={handleConditionChange}
              required
            />
            Excellent
          </label>
          <label htmlFor="good">
            <input
              type="radio"
              id="good"
              name="condition"
              value="Good"
              checked={condition === 'Good'}
              onChange={handleConditionChange}
              required
            />
            Good
          </label>
          <label htmlFor="fair">
            <input
              type="radio"
              id="fair"
              name="condition"
              value="Fair"
              checked={condition === 'Fair'}
              onChange={handleConditionChange}
              required
            />
            Fair
          </label>
          <label htmlFor="poor">
            <input
              type="radio"
              id="poor"
              name="condition"
              value="Poor"
              checked={condition === 'Poor'}
              onChange={handleConditionChange}
              required
            />
            Poor
          </label>
        </div>

        <label>Features:</label>
        <div>
          <label htmlFor="airConditioning">
            <input
              type="checkbox"
              id="airConditioning"
              name="features"
              value="Air Conditioning"
              checked={features.includes('Air Conditioning')}
              onChange={handleFeaturesChange}
            />
            Air Conditioning
          </label>
          <label htmlFor="powerSteering">
            <input
              type="checkbox"
              id="powerSteering"
              name="features"
              value="Power Steering"
              checked={features.includes('Power Steering')}
              onChange={handleFeaturesChange}
            />
            Power Steering
          </label>
          <label htmlFor="powerWindows">
            <input
              type="checkbox"
              id="powerWindows"
              name="features"
              value="Power Windows"
              checked={features.includes('Power Windows')}
              onChange={handleFeaturesChange}
            />
            Power Windows
          </label>
          <label htmlFor="abs">
            <input
              type="checkbox"
              id="abs"
              name="features"
              value="ABS"
              checked={features.includes('ABS')}
              onChange={handleFeaturesChange}
            />
            ABS
          </label>
          <label htmlFor="navigationSystem">
            <input
              type="checkbox"
              id="navigationSystem"
              name="features"
              value="Navigation System"
              checked={features.includes('Navigation System')}
              onChange={handleFeaturesChange}
            />
            Navigation System
          </label>
        </div>

        <label htmlFor="transmission">Transmission:</label>
        <select
          id="transmission"
          name="transmission"
          value={transmission}
          onChange={handleTransmissionChange}
          required
        >
          <option value="">Select</option>
          <option value="Automatic">Automatic</option>
          <option value="Manual">Manual</option>
        </select>

        <label htmlFor="priceRange">Price Range:</label>
        <input
          type="range"
          id="priceRange"
          name="priceRange"
          min="0"
          max="100000"
          value={priceRange[1]}
          onChange={(event) =>
            handlePriceRangeChange([priceRange[0], Number(event.target.value)])
          }
        />

        <label htmlFor="contactNumber">Contact Number:</label>
        <input
          type="text"
          id="contactNumber"
          name="contactNumber"
          value={contactNumber}
          onChange={handleContactNumberChange}
          required
        />

        <button type="submit">Submit</button>
      </form>
    </div>
  );
}

export default App;
